{"url": "https://habarileo.co.tz/majaliwa-amwakilisha-samia-tunisia/", "title": "\"Majaliwa amwakilisha Samia Tunisia - HabariLeo\"", "description": "\"WAZIRI Mkuu, Kassim Majaliwa ameondoka nchini kwenda Tunisia kumwakilisha Rais Samia Suluhu Hassan katika mkutano wa nane wa wakuu wa nchi na serikali wa TICAD. Taarifa ya ofisi ya Waziri Mkuu ilieleza jana kuwa mkutano huo utakaofanyika Agosti 27 na 28 mwaka huu utatoa fursa ya kupanga mikakati ya ushirikiano na ajenda za kimaendeleo zitakazotekelezwa\"", "keywords": "null"}
