{"url": "https://habarileo.co.tz/watoto-milioni-2-8-wakabiliwa-utapiamlo-afrika/", "title": "\"Watoto milioni 2.8 wakabiliwa utapiamlo Afrika - HabariLeo\"", "description": "\"WATOTO milioni 2.8 wanakabiliwa na utapiamlo katika nchi za Afrika, huku umaskini, vita na mabadiliko ya tabianchi vikitajwa kuendelea kuongeza idadi ya watu wenye utapiamlo wa kupindukia. Kwa mujibu wa Shirika la Umoja wa Mataifa la kuhudumia watoto (UNICEF), utapiamlo unatarajiwa kuongezeka kutokana na athari za kiuchumi za janga la Covid -19 na vita vinavyoendelea\"", "keywords": "null"}
