{"url": "https://habarileo.co.tz/karani-ahesabu-kaya-moja-kutwa-nzima-akutwa-bwiii-2/", "title": "\"Karani ahesabu kaya moja kutwa nzima, akutwa bwiii! - HabariLeo\"", "description": "\"WATU watatu wanashikiliwa na Jeshi la Polisi kwa kujaribu kukwamisha Sensa ya Watu na Makazi mjini Musoma. Mratibu wa Sensa wa Manispaa ya Musoma, Joseph Ochora amemtaja karani wa sensa, Thomas Ndyetabura kwamba anashikiliwa na polisi tangu juzi kwa kuhesabu kaya moja tu kutwa nzima, baadaye kukutwa akiwa amelewa. Kwa mujibu wa Ochora karani huyo\"", "keywords": "null"}
{"url": "https://habarileo.co.tz/simbachawene-anyoosha-kiburi-cha-mwanaye/", "title": "\"Simbachawene anyoosha kiburi cha mwanaye - HabariLeo\"", "description": "\"WAZIRI wa Nchi, Ofi si ya Waziri Mkuu (Sera, Bunge na Uratibu), George Simbachawene ameliagiza Jeshi la Polisi kumchukulia hatua za kisheria bila huruma mtoto wake kutokana na kosa la usalama barabarani alilolifanya. Simbachawene alilazimika kutoa kauli hiyo, baada ya kusambaa kwa video kwenye mitandao ya kijamii zikimwonesha akitoa lugha ya kuudhi kwa watu aliogonga\"", "keywords": "null"}
{"url": "https://habarileo.co.tz/jkt-yatangaza-nafasi-za-mafunzo-yakujitolea/", "title": "\"JKT yatangaza nafasi za mafunzo yakujitolea - HabariLeo\"", "description": "\"JESHI la Kujenga Taifa (JKT) limefungua rasmi usajili wa vijana kutoka Tanzania Bara na Visiwani kujiunga na Jeshi hilo kwa kujitolea. Usaili wa nafasi za mwaka 2022, umeanza rasmi leo Agosti 25, kwa mujibu wa Mkuu wa Tawi la Utawala JKT Brigedia Jenerali Hassan Mabena. Brigedia Jenerali Mabena amesema Mkuu wa JKT Meja Jenerali Rajabu\"", "keywords": "null"}
